insert into dataset values( 1995, 1838, 1759, '100679', 'Supporting data for "The draft nuclear genome assembly of Eucalyptus pauciflora: a pipeline for comparing de novo assemblies"', 'Eucalyptus pauciflora  (the snow gum) is a long-lived tree with high economic and ecological importance. Currently, little genomic information for  Eucalyptus pauciflora  is available. Here, we sequentially assemble the genome of  Eucalyptus pauciflora  with different methods, and combine multiple existing and novel approaches to help to select the best genome assembly. We generated high coverage of long- (Nanopore, 174x) and short- (Illumina, 228x) read data from a single  Eucalyptus pauciflora  individual and compared assemblies from five assemblers (Canu, SMARTdenovo, Flye, Marvel, and MaSuRCA) with different read lengths (1kb and 35 kb minimum read length). A key component of our approach is to keep a randomly selected collection of ~10% of both long- and short-reads separated from the assemblies to use as a validation set for assessing assemblies. Using this validation set along with a range of existing tools, we compared the assemblies in eight ways: contig N50, BUSCO scores, LAI (Long terminal repeat Assembly Index) scores, assembly ploidy, base-level error rate, CGAL (Computing Genome Assembly Likelihoods) scores, structural variation, and genome sequence similarity. Our result showed that MaSuRCA generated the best assembly, which is 594.87 Mb in size, with a contig N50 of 3.23 Mb, and an estimated error rate of ~0.006 errors per base. We report a draft genome of  Eucalyptus pauciflora  , which will be a valuable resource for further genomic studies of eucalypts. The approaches for assessing and comparing genomes, should help in assessing and choosing among many potential genome assemblies from a single dataset.', 9663676416, 'ftp://parrot.genomics.cn/gigadb/pub/10.5524/100001_101000/100679/', 'Incomplete', '100679newversion.xls', '099c7b19210fe26cbb44f40d886f57ec', null, null, 3, null, null );
